var app = angular.module('myapp', ['ui.router', 'ngAnimate']);
app.config(function($stateProvider, $urlRouterProvider, $locationProvider) {
  //
  // For any unmatched url, redirect to /state1
  $urlRouterProvider.otherwise("/");
  //
  // Now set up the states
  $stateProvider
    .state('home', {
    	url: "/",
    	templateUrl: "partials/home.html",
      controller: 'mainCtrl',
    })
    .state('skills', {
    	url: "/skills",
    	templateUrl: "partials/skills.html",
    	controller: 'mainCtrl'
    })
    .state('portfolio', {
    	url: "/portfolio",
    	templateUrl: "partials/portfolio.html",
    	controller: 'portfolioCtrl'
    })
    .state('equisolve', {
    	url: "/equisolve",
    	templateUrl: "partials/equisolve.html",
    	controller: 'equisolveCtrl'
    })
    .state('json', {
      url: "/json",
      templateUrl: "partials/json.html",
      controller: 'jsonCtrl'
    })
    .state('contact', {
      url: "/contact",
      templateUrl: "partials/contact.html",
      controller: 'contactCtrl'
    });
    $locationProvider.html5Mode(true);
});
app.run(function($rootScope, $state) {
    $rootScope.$state = $state;
});
app.directive('portfolioHeader', function() {
  return {
  	restrict: 'E',
    templateUrl: 'partials/portfolioHeader.html',
    replace:true
  };
});
app.directive('portfolioFooter', function() {
  return {
  	restrict: 'E',
    templateUrl: 'partials/portfolioFooter.html',
    replace:true
  };
});

app.controller('contactCtrl', ['$scope', '$http', function($scope,$http){
	$scope.sendmessage = function(){
		console.log('in here');
		if(!$scope.contactform.$invalid){
			$http.post('/mailer/mail.php', {name : $scope.name, email : $scope.email, message : $scope.message, grecaptcharesponse : $scope.gresponse},{headers: {'Content-Type': 'application/x-www-form-urlencoded'}})
			.success(function(data, status, headers, config) {
			    console.log(data);
			})
			.error(function(data, status, headers, config) {
			    console.log(data);
			});
		}
		return false;
	}
	setresponse = function(response){
		$scope.gresponse = response;
	}

}]);
